import React from 'react'
import {Link} from 'react-router-dom'
function UserLeft() {
  return (
    <div className='col-md-3'>
        
        <Link to=""><button className='btn btn-success'>Profile Page</button></Link>
        <Link to=""><button className='btn btn-success mt-2'>Search Page</button></Link>
        <Link to=""><button className='btn btn-success mt-2'>Tracking Page</button></Link>
        <Link to=""><button className='btn btn-success mt-2'>Diary</button></Link>
    </div>
  )
}

export default UserLeft
